import logo from './logo.svg';
import './App.css';
import {BrowserRouters,Routes,Route} from 'router-dom';
import Login from './Login/Login';


function App() {
  return (
    <div className="App">
      <BrowserRouters>
        <Routes>
          <Route path="Login"
          element={
            <Login/>
          }/>
          <Route path="Fstpage" 
          element={
            <Fstpage/>
          }/>
        </Routes>
      </BrowserRouters>

    </div>
  );
}

export default App;
